import React from 'react'
const Footer=()=>{
    return(
        <>
            <footer>
                <div className="container container-flex">
                    <div className="line">
                        ,<p>All rights reserved &copy;</p>
                    </div>
                </div>
            </footer>
        </>
    )
}
export default Footer;
